(4, '1.Can anyone recommend a fairly efficient way to check if an array contains only numeric keys?', 'PHP treats all arrays as associative, so there aren''t any built in functions. Can anyone recommend a fairly efficient way to check if an array contains only numeric keys?\r\n\r\nBasically, I want to be able to differentiate between this:\r\n\r\n$sequentialArray = array(''apple'', ''orange'', ''tomato'', ''carrot'');\r\nand this:\r\n\r\n$assocArray = array(''fruit1'' => ''apple'', \r\n                    ''fruit2'' => ''orange'', \r\n                    ''veg1'' => ''tomato'', \r\n                    ''veg2'' => ''carrot'');', 'tag', '2016-06-14 13:31:23', 1165),
(5, '2.How to check if PHP array is associative or sequential?', 'Surely this is a better alternative.\n\n$arr = array(1,2,3,4);\n$isIndexed = array_values($arr) === $arr;', 'tag', '2016-06-14 13:30:13', 1165),
(7, '<center><img src="http://www.altran.ch/uploads/tx_templavoila/Database-System_03.jpg"/></center>\n', 'Stack Overflow is a privately held website, the flagship site of the Stack Exchange Network,[4][5][6] created in 2008 by Jeff Atwood and Joel Spolsky.[7][8] It was created to be a more open alternative to earlier Q&A sites such as Experts-Exchange. The name for the website was chosen by voting in April 2008 by readers of Coding Horror, Atwood''s popular programming blog.[9]\n\nIt features questions and answers on a wide range of topics in computer programming.[10][11][12]\n\nThe website serves as a platform for users to ask and answer questions, and, through membership and active participation, to vote questions and answers up or down and edit questions and answers in a fashion similar to a wiki or Digg.[13] Users of Stack Overflow can earn reputation points and "badges"; for example, a person is awarded 10 reputation points for receiving an "up" vote on an answer given to a question, and can receive badges for their valued contributions,[14] which represents a kind of gamification of the traditional Q&A site or forum. All user-generated content is licensed under a Creative Commons Attribute-ShareAlike license.[15]\n\nClosing questions is a main differentiation from Yahoo! Answers and a way to prevent low quality questions.[16] The mechanism was overhauled in 2013; questions edited after being put "on hold" now appear in a review queue.[17] Jeff Atwood stated in 2010 that duplicate questions are not seen as a problem but rather they constitute an advantage if such additional questions drive extra traffic to the site by multiplying relevant keyword hits in search engines.[18]', 'home', '2016-06-15 12:00:39', 1165),
(8, '3.How to add elements to an empty array in PHP?', 'Both array_push and the method you described will work.\n\n\n$cart = array();\n$cart[] = 13;\n$cart[] = 14;\n// etc\n\nIs the same as:\n\n<\n$cart = array();\narray_push($cart, 13);\narray_push($cart, 14);\n\n// Or \n$cart = array();\narray_push($cart, 13, 14);\n\n\n', 'tag', '2016-06-15 09:53:20', 1165),
(9, '4.How  to  delete an element from an array?', 'Note that when you use unset() the array keys won''t change/reindex. If you want to reindex the keys you can use array_values() after unset() which will convert all keys to numerical enumerated keys starting from 0.\r\n\r\nCode\r\n\r\n\r\n\r\n    $array = array(0 => "a", 1 => "b", 2 => "c");\r\n    unset($array[1]);\r\n               //↑ Key which you want to delete\r\n\r\n\r\n\r\nOutput\r\n\r\nArray (\r\n    [0] => a\r\n    [2] => c\r\n)\r\narray_splice() method\r\n\r\nIf you use array_splice() the keys will be automatically reindexed, but the associative keys won''t change opposed to array_values() which will convert all keys to numerical keys.\r\n\r\nAlso array_splice() needs the offset, not the key!, as second parameter.\r\n\r\nCode\r\n\r\n\r\n\r\n    $array = array(0 => "a", 1 => "b", 2 => "c");\r\n    array_splice($array, 1, 1);\r\n                       //↑ Offset which you want to delete\r\n\r\n\r\n', 'tag', '2016-06-15 12:02:21', 1165),
(10, 'fff', 'ff', 'general', '2016-06-15 14:39:35', 0),
(11, 'Creating Associative Array in PHP?', '$shop = array(\n    array("appn1", "pub1" ,"pub2" , "pub3"),\n    array("appn2", "pub1"),\n    array("appn3", "pub1" ,"pub2")\n);\n$shopNew = array();\n\nforeach($shop as $value){\n    $shopNew[$value[0]] = end($value);\n}\n\n// now if you want you can replace $shop and unset $shopNew\n$shop = $shopNew;\nunset($shopNew);    \n\nprint_r($shop); \nthe output is this:\n\nArray (\n  [appn1] => pub3\n  [appn2] => pub1\n  [appn3] => pub2\n)', 'tag', '2016-06-16 09:48:22', 0),
(12, 'How to extract array from bigger associative array in php?', '$arr = array(\r\n        1 => array("ask","bat","cod","dig","egg","fur","gap","hay","ice","jar","kin","lee"), \r\n        2 => array("add","big","cap","day","eye","fat","gel","hop","ink","jog","key","law"),   \r\n        3 => array("axe","bin","cel","don","eat","fig","gig","hut","ion","jin","kid","lip")\r\n    );\r\n\r\n$arr_chosen = $arr[2];', 'tag', '2016-06-16 09:54:37', 0);
